import React from "react";
import { Container, Grid } from "semantic-ui-react";
import RankIcon from "./RankIcon";

function ProfileInfo() {
  return (
    <Container className="devBorders ">
      <Grid columns={4}>
        <Grid.Row>
          <Grid.Column />
          <Grid.Column fluid>
            <RankIcon />
          </Grid.Column>
          <Grid.Column>
            <Container>{localStorage.username}</Container>
          </Grid.Column>
          <Grid.Column />
        </Grid.Row>
      </Grid>
    </Container>
  );
}

export default ProfileInfo;
